import React from 'react';
import logo from './logo.svg';
import {Route, Switch} from 'react-router-dom';
import './App.css';
import Layout from './Layout';
import AdminHome from './Admin/Home';

function App() {
  return (
    <div className="App">
        <Route path = "/" exact component = {LogIn} />
        <Layout/>
      <AdminHome/>
    </div>
  );
}

export default App;
